import React, { Component } from 'react';

export default class Bangladesh extends Component {
  render() {
    return (
        <div> 
            <div class="container">
                <div class="third"><vh-corona-tracker></vh-corona-tracker></div>
                <div class="two-thirds"><vh-corona-tracker></vh-corona-tracker></div>
                
            </div>


            <vh-corona-tracker></vh-corona-tracker>
        </div>
    );
  }
}
